import { render } from '@testing-library/react'
import React, { Component } from 'react';
import { getAuth, signInWithPopup, GoogleAuthProvider } from "firebase/auth";
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Landing from './routes/Landing';
import TestLink from './routes/exam/TestLink';
import StartTest from './routes/exam/StartTest';
import Result from './routes/exam/Result';
import { authentication } from './'


function App() {




        return (
            <div>
                <Routes>
                    <Route exact path="/home" element={<Landing />} />
                    <Route path="/testlink" component={<TestLink />} />
                    <Route path="/starttest/:testid" component={<StartTest />} />
                    <Route path="/result/:testid" component={<Result />} />
                </Routes>
            </div>
        )
    }



export default App;
